    body {
        margin: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
    }
    
    #content-root {
        text-align: center;
    }
    
    .page-loading-messagebox {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        text-align: center;
    }
    
    .cv-page-loading-block {
        display: flex;
        flex-direction: row;
        align-items: center;
        justify-content: center;
    }
    
    .cv-spinner-tile-animation {
        width: 28px;
        height: 28px;
        border: 1.5px solid;
        border-radius: 50%;
        animation: roll 1.3s linear infinite;
        display: inline-block;
        vertical-align: middle;
        border-color: #2266e3 #9cbeff #9cbeff;
        border-image: initial;
    }
    
    .cv-page-loading-message {
        color: #2266e3;
        font-family: "Segoe UI","Segoe WP",Tahoma,Arial,sans-serif;
        font-size: 17px;
        margin: 10px 20px 10px 8px;
        display: inline-block;
        vertical-align: middle;
        line-height: 100%;
    }
	
    
    @keyframes roll {
        0% {
            transform: rotate(0deg);
        }
        100% {
            transform: rotate(360deg);
        }
    }
    
    /* Media Query for smaller screens */
    @media (max-width: 600px) {
        .cv-spinner-tile-animation {
            width: 20px;
            height: 20px;
            border-width: 1px;
        }
    }
    </style>
